import math
import numpy as np

def m82_01( x, y, z, r_0, h_0, density):
	"""
	m82_01 - Gives gas density for constant core with exponential decrement outside core
	"""
	r=math.sqrt(x**2+y**2)
	if (r<=r_0) and (abs(z)<=h_0):
		return density
	elif r<=r_0:
		return density*math.exp(-(abs(z)-h_0)/h_0)
	elif abs(z)<=h_0:
		return density*math.exp(-(r-r_0)/r_0)
	else:
		return density*math.exp(-(r-r_0)/r_0)*math.exp(-(abs(z)-h_0)/h_0)

		
def m82_wind_01( x, y, z, r0, r1, z0, z1, v0_r, v0_z, density, mass_loss):
	"""
	m82_wind_01
	Gives gas density for wind in z-direction around core assuming cylindrical coordinates.
	
	distances in kpc
	velocites in km/s
	density in cm^-2
	mass_loss in solar_masses/year
	"""
	r=math.sqrt(x**2+y**2)
	
	#Calculating WIND
	v_conv_r = v0_r*0.5*( 1.0+math.tanh( 4.0*abs(r/r0)-4.0 ) )
	v_conv_z = v0_z*0.5*( 1.0+math.tanh( 4.0*abs(z/z0)-4.0 ) )
	if z < 0.0:
		v_conv_z *= -1.0
	if r >= r0:
		v_conv_r *= math.exp(-1.0*(r-r0)/r1)
		v_conv_z *= math.exp(-1.0*(r-r0)/r1)
	v = math.sqrt(v_conv_r**2+v_conv_z**2)
	
	#CONSTANTS
	solar_mass = 2.0e+30 #kg
	mass_H = 1.67e-27 #kg
	s_per_year = 3.15576e+7 #s
	cm_per_kpc = 3.086e+21 #cm
	
	#Density due to wind
	particle_mass = mass_H
	area = math.pi*(r0*cm_per_kpc)**2
	
	n_wind = mass_loss*(solar_mass/particle_mass)/s_per_year
	n_wind /= v*1.0e+5*area 
	
	if r > r0:
		n_wind = 0
	
	output_wind = n_wind
	
	factor = 0.05
	if n_wind > factor*density:
		output_wind = factor*density
	
	#Static density
	if (r <= r0) and (abs(z) <= z0):
		output = density
	elif (r <= r0) and (abs(z) > z0):
		output = density*math.exp(-(abs(z)-z0)/z0)
	elif (r > r0) and (abs(z) <= z0):
		output = density*math.exp(-(r-r0)/r0)
	else:
		output = density*math.exp(-(r-r0)/r0)*math.exp(-(abs(z)-z0)/z0)

	return (output+output_wind)
	
def m82_wind_radial( x, y, z, r0, r1, rwind, z0, z1, v0_r, density, mass_loss):	
	"""
	m82_wind_01
	Gives gas density for wind in z-direction around core assuming cylindrical coordinates.
	
	distances in kpc
	velocites in km/s
	density in cm^-2
	mass_loss
	"""
	r=math.sqrt(x**2+y**2+z**2)
	v = v0_r*0.5*( 1.0+math.tanh( 4.0*abs(r/rwind)-4.0 ) )
	
	#CONSTANTS
	solar_mass = 2.0e+30 #kg
	mass_H = 1.67e-27 #kg
	s_per_year = 3.15576e+7 #s
	cm_per_kpc = 3.086e+21 #cm
	
	#Density due to wind
	particle_mass = mass_H
	area = math.pi*(r*cm_per_kpc)**2
	
	if v > 0 and r > 0:
		n_wind = mass_loss*(solar_mass/particle_mass)/s_per_year
		n_wind /= v*1.0e+5*area*4
	else:
		n_wind = 10000*density
	
	output_wind = n_wind
	
	factor = 1.e-2
	if n_wind > factor*density:
		output_wind = factor*density
	
	#Static density
	if (r <= r0) and (abs(z) <= z0):
		output = density
	elif (r <= r0) and (abs(z) > z0):
		output = density*math.exp(-(abs(z)-z0)/z1)
	elif (r > r0) and (abs(z) <= z0):
		output = density*math.exp(-(r-r0)/r1)
	else:
		output = density*math.exp(-(r-r0)/r1)*math.exp(-(abs(z)-z0)/z1)

	return (output+output_wind)
	
def m82_wind_radial_v2( x, y, z, r0, r1, rwind, z0, z1, v0_r, density, mass_loss, power_law):	
	"""
	m82_wind_01
	Gives gas density for wind in z-direction around core assuming cylindrical coordinates.
	
	distances in kpc
	velocites in km/s
	density in cm^-2
	mass_loss
	"""
	r=math.sqrt(x**2+y**2+z**2)
	v = v0_r*0.5*( 1.0+math.tanh( 4.0*abs(r/rwind)-4.0 ) )
	
	#CONSTANTS
	solar_mass = 2.0e+30 #kg
	mass_H = 1.67e-27 #kg
	s_per_year = 3.15576e+7 #s
	cm_per_kpc = 3.086e+21 #cm
	
	#Density due to wind
	particle_mass = mass_H
	area = math.pi*(r*cm_per_kpc)**2
	
	if v > 0 and r > 0:
		n_wind = mass_loss*(solar_mass/particle_mass)/s_per_year
		n_wind /= v*1.0e+5*area*4
	else:
		n_wind = 10000*density
	
	output_wind = n_wind
	
	factor = 1.e-2
	if n_wind > 0.1:
		output_wind = 0.1
	
	r=math.sqrt(x**2+y**2)
	#Static density
	if (r <= r0) and (abs(z) <= z0):
		output = density
	elif (r <= r0) and (abs(z) > z0):
		output = density*((abs(z)-z0+z1)/z1)**power_law
	elif (r > r0) and (abs(z) <= z0):
		output = density*math.exp(-(r-r0)/r1)
	else:
		output = density*math.exp(-(r-r0)/r1)*((abs(z)-z0+z1)/z1)**power_law

	return (output+output_wind)
	
