def m82_wind_radial_v5( x, y, z, density, r0, r1, rwind, z0, z1, v0, mass_loss):	
	"""
	Exponential core + wind
	Gives gas density for wind in z-direction around core assuming cylindrical coordinates.
	
	distances in kpc
	velocites in km/s
	density in cm^-2
	mass_loss
	"""
	r=math.sqrt(x**2+y**2+z**2)
	v=v0
	
	#CONSTANTS
	solar_mass = 2.0e+30 #kg
	mass_H = 1.67e-27 #kg
	s_per_year = 3.15576e+7 #s
	cm_per_kpc = 3.086e+21 #cm
	
	#Density due to wind
	particle_mass = mass_H
	area = math.pi*(r*cm_per_kpc)**2
	
	if v > 0 and r > 0:
		n_wind = mass_loss*(solar_mass/particle_mass)/s_per_year
		n_wind /= v*1.0e+5*area*4
	else:
		n_wind = 10000*density
	
	output_wind = n_wind
	
	if n_wind > density:
		output_wind = density
	
	R=math.sqrt(x**2+y**2)
	#Static density
	if (R <= r0) and (abs(z) <= z0):
		output = density
	else:
		theta = abs(math.atan(z/R))
		theta_s = abs(math.atan(z0/r0))
		
		if theta >= theta_s:
			r_newcore = z0/math.sin(theta)
			r_newscale = z1/math.sin(theta)
		else:
			r_newcore = r0/math.cos(theta)
			r_newscale = r1/math.cos(theta)
		
		output = density*math.exp(-(r-r_newcore)/r_newscale)

	return max(output,output_wind)
	
def m82_wind_radial_v6( x, y, z, density, r0, r1, z0, z1, v0, mass_loss):	
	"""
	Exponential core + wind
	Gives gas density for wind in z-direction around core assuming cylindrical coordinates.
	
	distances in kpc
	velocites in km/s
	density in cm^-2
	mass_loss
	"""
	r=math.sqrt(x**2+y**2+z**2)
	v=v0
	
	#CONSTANTS
	solar_mass = 2.0e+30 #kg
	mass_H = 1.67e-27 #kg
	s_per_year = 3.15576e+7 #s
	cm_per_kpc = 3.086e+21 #cm
	
	#Density due to wind
	particle_mass = mass_H
	area = math.pi*(r*cm_per_kpc)**2
	
	if v > 0 and r > 0:
		n_wind = mass_loss*(solar_mass/particle_mass)/s_per_year
		n_wind /= v*1.0e+5*area*4
	else:
		n_wind = 10000*density
	
	output_wind = n_wind
	
	if n_wind > density:
		output_wind = density
	
	#Static density
	R=math.sqrt(x**2+y**2)
	theta = (math.atan2(abs(z),R))
	
	r_newcore = np.sqrt( (z0*math.sin(theta))**2. + (r0*math.cos(theta))**2. )
	r_newscale = np.sqrt( (z1*math.sin(theta))**2. + (r1*math.cos(theta))**2. )
	
	if (r <= r_newcore):
		output = density
	else:
		output = density*math.exp(-(r-r_newcore)/r_newscale)

	return max(output,output_wind)
	
def m82_wind_radial_v7( x, y, z, density, r0, r1, z0, z1, v0, mass_loss):	
	"""
	Exponential core + wind
	Gives gas density for wind in z-direction around core assuming cylindrical coordinates.
	
	distances in kpc
	velocites in km/s
	density in cm^-2
	mass_loss
	"""
	r=math.sqrt(x**2+y**2+z**2)
	v=v0
	
	#CONSTANTS
	solar_mass = 2.0e+30 #kg
	mass_H = 1.67e-27 #kg
	s_per_year = 3.15576e+7 #s
	cm_per_kpc = 3.086e+21 #cm
	
	#Density due to wind
	particle_mass = mass_H
	area = math.pi*(r*cm_per_kpc)**2
	
	if v > 0 and r > 0:
		n_wind = mass_loss*(solar_mass/particle_mass)/s_per_year
		n_wind /= v*1.0e+5*area*4
	else:
		n_wind = 10000*density
	
